// ==UserScript==
// @name         DA Icon Desuckifier
// @namespace    http://crowbar.co.nz
// @version      0.4
// @description  Reverts deviantART's new ugly icon to the old good one.
// @author       Anorexorcist
// @include      http://www.deviantart.com/*
// @include      http://*.deviantart.com/*
// @include      *://*.deviantart.*/*
// @include      *://*.deviantart.*/
// @include      *.deviantart.*
// @grant        none
// ==/UserScript==

// var _daico='data:image/png;base64,';

(function(d, h) {
  // Create this favicon
	var ss = d.createElement('link');
	ss.rel = 'shortcut icon';
	ss.type = 'image/x-icon';
	ss.href = 'data:image/x-icon;base64,';	// Remove any existing favicons
	var links = h.getElementsByTagName('link');
	for (var i=0; i<links.length; i++) {
		if (links[i].href == ss.href) return;
		if (links[i].rel == "shortcut icon" || links[i].rel=="icon")
			h.removeChild(links[i]);
	}
	// Add this favicon to the head
	h.appendChild(ss);
	// Force browser to acknowledge
	var shim = document.createElement('iframe');
	shim.width = shim.height = 0;
	document.body.appendChild(shim);
	shim.src = "icon";
	document.body.removeChild(shim);

})(document, document.getElementsByTagName('head')[0]);